let TimeStampBase = require('../base/TimeStampBase');
let Schema        = require('../utils/Schema');

let OrgEntityTypes = new Schema(TimeStampBase, {
    fields    : {
        le_id      : "timeuuid",
        type_id    : "timeuuid",
        type_code  : "text",
        description: "text",
        is_active  : "boolean",
        org_code   : "text",
        org_id     : "timeuuid",
        type_name  : "text",
    },
    key       : [["le_id"], "type_id", "type_code"],
    table_name: "org_entity_types"
});

module.exports = OrgEntityTypes.model();


